    }
 
    render(){
        return (
            <div>
                {/* <Button onClick={openLoginModal}>
                    Open Modal
                </Button>

                <Modal
                    isOpen={isOpenLoginModal} 
                    closeModal={closeLoginModal}
                    title="soy un Modal"
                >
                    <form>
                    <input 
                        type="email"
                        placeholder="Correo"
                    />
                    <input 
                        type="password"
                        placeholder="Contraseña"
                    />
                    </form>
                </Modal> */}
                <MyNotify
                    type={'success'} 
                    title= {'Operación realizada con éxito'}
                    message="Soy un Toast"
                />
                {
                    this.state.valor.map(mont => (
                        <div key={mont.id}>
                        <PaypalCheckout
                            precio = {mont.Pago}
                            id_rva = {1}
                        />
                        </div>
                    ))
                }

            <button onClick="window.print">
                Boton
            </button>
                

            </div>
        )
    }
}
